import React,{useState} from 'react';
import './App.css';

//Containers
import Main from "./containers/Main";
import Header from './containers/Header';
import Footer from './containers/Footer';

//Components
import News from './components/News';
import SearchBar from './components/SearchBar';
import Trending from './components/Trending';
import Highest from "./components/Highest";
import Placeholder from './components/Placeholder'
import BannerAd from './components/BannerAd';

export default function App (){
  const [isGuyClicked,setIsGuyClicked]=useState(false);

  return(
    <div className="app" id='app'>

      <Header>
        <h1 className="title">FlavorTown</h1>
        <SearchBar /> 
      </Header>

      {isGuyClicked?
      <Main>
        'Yes'
      </Main>
      :
      <Main>
        <News />
        <BannerAd src="http://realpants.com/wp-content/uploads/2015/03/648x300xpromo-guy-fieri-savory-sausages.jpg.pagespeed.ic_.5TFvSsrJ8x.jpg" />


          <Trending /> 
          <Highest /> 
      </Main>
      }


    <Footer>
      <img src="https://myrealdomain.com/images/guy-fieri-png-1.png" width="100px" height="100px" alt='' className="guysRandom__image" />
      <button className='guysRandom__button' onClick={()=>setIsGuyClicked(!isGuyClicked)}>Guy! I need a Recipe </button>
    </Footer>
    </div>
  )
}
